INSERT INTO `advisors_about` (`advisor_id`, `brief_about`) VALUES
(25, 'gh,l'),
(28, 'Frank Smithson, CPA, CCPS \r\nRecognized as the leading expert in â€œproactiveâ€ college funding solutions for families.  He has written books, developed software, and trained more financial  professionals on reducing the cost of college than any one else in America.  He is a co-founder of the National Institute of Certified College Planners. \r\n\r\nRick often teaches advisors how to identify the true costs of college, how to find the â€œfree moneyâ€, how to use Education Tax Incentives, how to maximize cash flow during college years, and how to reduce the need for loans to pay for college!\r\n'),
(20, 'Wisconsin College Planning, LLC  provides college bound students with financial strategies, \r\n guidance in selecting the right school, and  peace of mind in knowing that every aspect of â€œmeritâ€ and â€œneedâ€ based aid is being addressed with the highest standard of expertise.  Steven L. Nimmer, the driving force behind Wisconson College Planning, is on the Board of Directors for the National Association of Insurance and Financial Advisors, is certified by the National Institute of College Planning Specialists and is a member of the Partners in Education.'),
(21, ''),
(22, ''),
(23, 'Education Funding Solutions, Inc. (EFS) provides college-bound or private high school bound students and their parents the peace-of-mind of knowing that the student is attending the right school at the right price.  Our client families receive state-of-the-art career/college selection services, comprehensive test prep and tutoring, and college financial advice derived from our principalsâ€™ combined 65 years of general and college financial planning expertise.\r\n\r\nEFS serves New Jersey families from its headquarters in Bridgewater, NJ and Pennsylvania families from its Doylestown, PA branch office.  Call, click or visit to learn how we can help you afford and attain your college dreams.\r\n\r\nEFS donates 12% of its profits to help low-income students.\r\n'),
(24, 'The American Education Group understands that preparing and paying for college can be a very stressful time.  We know how important it is for you to have answers you can depend on.  American Education Funding has become an important guidance and information resource for high school students and families.\r\n\r\n'),
(29, ''),
(26, ''),
(27, ''),
(30, ''),
(31, '');
